import{_ as r,c as a,a as t,o as h}from"./app.109432a7.js";const c=JSON.parse('{"title":"2022 11\uC6D4 \uD68C\uACE0","description":"","frontmatter":{"title":"2022 11\uC6D4 \uD68C\uACE0","createBy":"2022-12-09T00:00:00.000Z"},"headers":[{"level":2,"title":"","slug":"_11\uC6D4-\uD68C\uACE0\uB85D"},{"level":2,"title":"(1) \uC77C\uBCF8\uC5EC\uD589","slug":"_1-\uC77C\uBCF8\uC5EC\uD589"},{"level":2,"title":"(2) \uCF54\uB85C\uB098","slug":"_2-\uCF54\uB85C\uB098"},{"level":2,"title":"(3) \uCE5C\uAD6C\uB4E4\uACFC \uD504\uB85C\uC81D\uD2B8","slug":"_3-\uCE5C\uAD6C\uB4E4\uACFC-\uD504\uB85C\uC81D\uD2B8"}],"relativePath":"sdhs/2211/11\uC6D4\uD68C\uACE0.md"}'),i={name:"sdhs/2211/11\uC6D4\uD68C\uACE0.md"};function l(s,e,d,n,p,o){return h(),a("div",null,e[0]||(e[0]=[t('<h2 id="_11\uC6D4-\uD68C\uACE0\uB85D" tabindex="-1"><h2 style="font-size:30px;">11\uC6D4 \uD68C\uACE0\uB85D</h2> <a class="header-anchor" href="#_11\uC6D4-\uD68C\uACE0\uB85D" aria-hidden="true">#</a></h2><p>\uBC8C\uC368 2022\uB144\uB3C4 1\uB2EC\uC774\uB780 \uBC16\uC5D0 \uC548\uB0A8\uC558\uB2E4. \uC774\uBC88\uB2EC\uC740 \uB098\uC5D0\uAC8C \uC788\uC5B4\uC11C \uACE0\uB4F1\uD559\uAD50 \uC0DD\uD65C\uC911 \uAC00\uC7A5 \uB9CE\uC774 \uB180\uC558\uB358 \uB2EC\uC774\uB2E4. \uAE30\uB2A5\uB300\uD68C\uCE21\uC778\uC9C0 \uC11C\uC6B8\uC2DC\uC778\uC9C0\uB294 \uC798 \uBAA8\uB974\uACA0\uC9C0\uB9CC \uC804\uAD6D\uB300\uD68C \uC11C\uC6B8 \uC720\uACF5\uC790\uB4E4(\uC804\uAD6D\uB300\uD68C \uBA54\uB2EC\uAD8C)\uC5D0\uAC8C \uC77C\uBCF8\uC5EC\uD589\uC744 \uBCF4\uB0B4\uC918\uC11C 4\uBC15 5\uC77C\uB85C \uC77C\uBCF8\uB3C4 \uAC14\uB2E4\uC624\uACE0 \uCF54\uB85C\uB098\uC5D0 \uAC78\uB824\uC11C 1\uC8FC\uB3D9\uC548 \uC790\uAC00\uACA9\uB9AC \uB2F9\uD558\uBA74\uC11C \uC274\uC218 \uC788\uC5C8\uB2E4. \uB2E4\uB978 \uC0AC\uB78C\uB4E4\uC774 \uBCF4\uAE30\uC5D0\uB294 \uD559\uC0DD\uC774\uB77C\uBA74 \uBC29\uD559\uC774 \uAC00\uC7A5 \uB9CE\uC774 \uC274\uC218 \uC788\uC9C0\uC54A\uB0D0\uACE0 \uB9D0\uD560\uC218\uB3C4 \uC788\uACA0\uC9C0\uB9CC \uB09C \uBC29\uD559\uC5D0\uB3C4 \uD559\uAD50\uC5D0 \uAC00\uC11C.. <br><br> \uC6B0\uC120 \uC774\uBC88\uB2EC\uC5D0 \uD55C\uC77C\uC911\uC5D0 \uAC00\uC7A5 \uB300\uD45C\uC801\uC778 \uC77C\uB4E4\uC740 \uC774 3\uAC1C\uB85C \uB098\uB20C\uC218 \uC788\uB2E4.</p><h2 id="_1-\uC77C\uBCF8\uC5EC\uD589" tabindex="-1">(1) \uC77C\uBCF8\uC5EC\uD589 <a class="header-anchor" href="#_1-\uC77C\uBCF8\uC5EC\uD589" aria-hidden="true">#</a></h2><hr><p>\uC6B0\uC120 \uCCAB\uBC88\uC9F8\uB85C \uC77C\uBCF8\uC5EC\uD589. 11\uC6D4 7\uC77C\uBD80\uD130 11\uAE4C\uC9C0 \uCD1D 4\uBC15 5\uC77C\uAC04 \uC77C\uBCF8\uC5EC\uD589\uC744 \uB2E4\uB140\uC654\uB2E4. \uC911\uD559\uAD50 3\uD559\uB144\uB54C \uC81C\uC8FC\uB3C4\uB85C \uC218\uD559\uC5EC\uD589\uC744 \uAC04\uAC78 \uB9C8\uC9C0\uB9C9\uC73C\uB85C \uCC98\uC74C\uC73C\uB85C \uB5A0\uB09C \uC5EC\uD589\uC774\uC5C8\uB2E4 (\uC77C\uBCF8 \uC5EC\uD589\uC774 \uCC98\uC74C\uC774\uAE30\uB3C4 \uD558\uACE0).</p><p>\uC5EC\uAE30\uC11C \uC804\uBD80 \uC774\uC57C\uAE30\uD558\uBA74 \uAE00\uC774 \uAE38\uC5B4\uC9C0\uAE30 \uB54C\uBB38\uC5D0 \uC77C\uBCF8\uC5EC\uD589 \uAD00\uB828 \uAE00\uC740 \uB098\uC911\uC5D0 \uB530\uB85C \uC791\uC131\uD560 \uC608\uC815\uC774\uB2E4.</p><h2 id="_2-\uCF54\uB85C\uB098" tabindex="-1">(2) \uCF54\uB85C\uB098 <a class="header-anchor" href="#_2-\uCF54\uB85C\uB098" aria-hidden="true">#</a></h2><hr><p>\uCF54\uB85C\uB098 \uBC14\uC774\uB7EC\uC2A4\uAC00 \uC0DD\uAE30\uACE0 2\uB144 11\uAC1C\uC6D4 \uCC98\uC74C\uC73C\uB85C \uCF54\uB85C\uB098\uC5D0 \uAC78\uB838\uB2E4. \uC194\uC9C1\uD788 \uC774\uC815\uB3C4\uB85C \uBC84\uD2F0\uACE0 \uBC31\uC2E0\uB3C4 \uB9DE\uC558\uC73C\uBA74 \uD56D\uCCB4\uB77C\uB3C4 \uBAB8\uC774 \uC0DD\uAE38\uC904 \uC54C\uC558\uB294\uB370 \uC5B4\uC774\uC5C6\uAC8C \uAC78\uB824 \uBC84\uB838\uB2E4. \uB0B4\uAC00 \uB2E4\uB2C8\uACF3\uC774\uB77C\uACE0\uB294 \uC9D1, \uD68C\uC0AC \uC798\uD574\uBD24\uC790 \uD5EC\uC2A4\uC7A5 \uC774 3\uACF3\uC774 \uB05D\uC778\uB370 \uB3C4\uB300\uCCB4 \uC5B4\uB514\uC11C \uAC78\uB9AC\uAC83\uC778\uC9C0.. <br><br> \uC544\uBB34\uD2BC \uCEE8\uB514\uC158\uC774 \uC548\uC88B\uC544\uC11C \uCF54\uB85C\uB098 \uC790\uAC00\uC9C4\uB2E8 \uD0A4\uD2B8\uB85C \uAC80\uC0AC\uD574\uBD24\uB294\uB370 \uCF54\uB85C\uB098 \uC591\uC131\uC774 \uB5A0\uBC84\uB838\uB2E4. \uC758\uB3C4\uCE58 \uC54A\uAC8C 1\uC8FC\uC5D0 \uC5F0\uD734\uAC00 \uC0DD\uACA8\uBC84\uB838\uB2E4. \uBAB8 \uC0C1\uD0DC\uB3C4 \uCCAB\uB0A0\uC744 \uC81C\uC678\uD558\uBA74 \uAD1C\uCC2E\uACE0 \uC57D\uC744 \uBA39\uACE0 \uC788\uAE34 \uD588\uC9C0\uB9CC \uAE30\uCE68\uC774 \uC880 \uB098\uC624\uB294\uAC70 \uBE7C\uACE0 \uAD1C\uCC2E\uC544\uC11C \uCC98\uC74C\uC5D0\uB294 1\uC8FC\uB3D9\uC548 \uC9D1\uC5D0\uC11C \uD3B8\uD558\uAC8C \uC990\uAE38\uB824\uACE0 \uD588\uB2E4. <br><br> \uD558\uC9C0\uB9CC... <br><br> \uC544\uBB34 \uC99D\uC0C1\uC774 \uC5C6\uC5B4\uB3C4 \uBAB8\uC740 \uC548 \uAD1C\uCC2E\uC558\uB294\uC9C0 1\uC8FC\uB0B4\uB0B4 \uD558\uB8E8\uC885\uC77C \uC7A4\uB2E4. \uAE30\uC5B5\uC5D0 \uB0A8\uB294\uAC70\uB77C\uACE0\uB294 \uC7A4\uB358\uAE30\uC5B5 \uBC16\uC5D0 \uC5C6\uB2E4. \uADF8\uB098\uB9C8 \uC544\uD504\uC9C0\uB294 \uC54A\uC558\uB358\uAC8C \uB2E4\uD589\uC774\uB77C\uACE0 \uD574\uC57C\uD558\uB098..? <br> \uBD84\uBA85 \uCCAB\uB0A0\uC774 \uC9C0\uB098\uACE0\uB294 \uAD1C\uCC2E\uC558\uC9C0\uB9CC \uB9E4\uC77C 12\uC2DC\uAC04 \uC774\uC0C1\uC744 \uC790\uAC8C \uB418\uACE0 3\uC77C\uC9F8 \uB418\uB294 \uB0A0\uBD80\uD130\uB294 \uBBF8\uAC01\uACFC \uD6C4\uAC01\uC774 \uC5C6\uC5B4\uC84C\uB2E4. \uBBF8\uAC01\uB3C4 \uC5C6\uC5B4\uC84C\uACE0 \uC9D1\uC5D0\uC11C\uB294 \uBC25\uC744 \uC798 \uC548 \uCC59\uACA8\uBA39\uC5B4\uC11C \uCF54\uB85C\uB098 \uAE30\uAC04\uB3D9\uC548 1kg \uC815\uB3C4 \uBAB8\uBB34\uAC8C\uAC00 \uBE60\uC84C\uB2E4 (\uC774\uAC74 \uAC1C\uAFC0\uC778\uB4EF).</p><h2 id="_3-\uCE5C\uAD6C\uB4E4\uACFC-\uD504\uB85C\uC81D\uD2B8" tabindex="-1">(3) \uCE5C\uAD6C\uB4E4\uACFC \uD504\uB85C\uC81D\uD2B8 <a class="header-anchor" href="#_3-\uCE5C\uAD6C\uB4E4\uACFC-\uD504\uB85C\uC81D\uD2B8" aria-hidden="true">#</a></h2><hr><p>\uB9C8\uC9C0\uB9C9\uC740 \uCE5C\uAD6C, \uD6C4\uBC30\uB4E4\uACFC \uD504\uB85C\uC81D\uD2B8\uB97C \uD558\uAC8C \uB41C\uAC83\uC774\uB2E4. \uC194\uC9C1\uD788 \uB0A9\uCE58\uB2F9\uD588\uB2E4. \uB204\uC6CC\uC11C \uC720\uD29C\uBE0C \uBCF4\uACE0 \uC788\uB294\uB370 \uAC11\uC790\uAE30 \uB514\uCF54\uBC29\uC5D0 \uCD08\uB300\uB418\uB354\uB2C8 \uD504\uB85C\uC81D\uD2B8\uB97C \uC9C4\uD589\uD55C\uB2E4\uACE0 \uD574\uC11C \uAC19\uC774 \uD558\uAC8C \uB418\uC5C8\uB2E4. flutter\uB85C \uD558\uB294 \uC571 \uD504\uB85C\uC81D\uD2B8\uC778\uB370 \uC194\uC9C1\uD788 \uD68C\uC0AC \uB05D\uB098\uACE0 \uC9D1\uC5D0 \uC640\uC11C \uACF5\uBD80\uD558\uB294\uAC8C \uD798\uB4E4\uB2E4. \uC77C\uB2E8 \uD5EC\uC2A4\uAE4C\uC9C0 \uD558\uACE0 \uC9D1\uC5D0 \uC624\uBA74 \uC2DC\uAC04\uB3C4 \uBCC4\uB85C \uC5C6\uACE0 \uBB34\uC5C7\uBCF4\uB2E4 \uC9D1\uC5D0\uC640\uC11C \uACF5\uBD80\uD558\uAE30\uAC00 \uB108\uBB34 \uC2EB\uB2E4(\uD798\uB4E4\uC5B4..). <br><br> \uADF8\uB798\uB3C4 \uC774\uC655 \uC2DC\uC791\uD55C \uD504\uB85C\uC81D\uD2B8\uC774\uB2C8 \uC8FC\uB9D0\uC5D0\uB77C\uB3C4 \uACF5\uBD80\uD574\uC11C \uB9C8\uAC10\uC77C\uAE4C\uC9C0 \uC5F4\uC2EC\uD788 \uD574\uBD10\uC57C\uACA0\uB2E4.</p><br><br><br><br><br><h1 style="font-size:37px;margin:7px 0px 12px;">Keep</h1><h4 id="\uC798\uD558\uACE0-\uC788\uB294-\uC810-\uACC4\uC18D-\uD588\uC73C\uBA74-\uC88B\uACA0\uB2E4-\uC2F6\uC740-\uC810" tabindex="-1">\uC798\uD558\uACE0 \uC788\uB294 \uC810. \uACC4\uC18D \uD588\uC73C\uBA74 \uC88B\uACA0\uB2E4 \uC2F6\uC740 \uC810. <a class="header-anchor" href="#\uC798\uD558\uACE0-\uC788\uB294-\uC810-\uACC4\uC18D-\uD588\uC73C\uBA74-\uC88B\uACA0\uB2E4-\uC2F6\uC740-\uC810" aria-hidden="true">#</a></h4><hr><ul><li><p style="font-size:17px;font-weight:bold;">\uCE5C\uAD6C\uB4E4\uACFC \uD504\uB85C\uC81D\uD2B8\uB97C \uC2DC\uC791\uD588\uB2E4. \uB9CC\uC57D \uC798 \uB9C8\uBB34\uB9AC\uB41C\uB2E4\uBA74 \uD3EC\uD3F4\uC5D0\uB3C4 \uB4E4\uC5B4\uAC00\uACE0 \uB2E4\uC74C\uC5D0 \uB610 \uB2E4\uB978 \uD504\uB85C\uC81D\uD2B8\uB3C4 \uAC19\uC774 \uD558\uC9C0 \uC54A\uC744\uAE4C \uC2F6\uB2E4.</p></li></ul><br><br><br><h1 style="font-size:37px;margin:7px 0px 12px;">Problem</h1><h4 id="\uBB54\uAC00-\uBB38\uC81C\uAC00-\uC788\uB2E4-\uC2F6\uC740-\uC810-\uBCC0\uD654\uAC00-\uD544\uC694\uD55C-\uC810" tabindex="-1">\uBB54\uAC00 \uBB38\uC81C\uAC00 \uC788\uB2E4 \uC2F6\uC740 \uC810. \uBCC0\uD654\uAC00 \uD544\uC694\uD55C \uC810. <a class="header-anchor" href="#\uBB54\uAC00-\uBB38\uC81C\uAC00-\uC788\uB2E4-\uC2F6\uC740-\uC810-\uBCC0\uD654\uAC00-\uD544\uC694\uD55C-\uC810" aria-hidden="true">#</a></h4><hr><ul><li><p style="font-size:17px;font-weight:bold;">\uC694\uC998 \uC544\uCE68\uC5D0 \uC77C\uC5B4\uB098\uB294\uAC8C \uB108\uBB34 \uD798\uB4E4\uB2E4. \uC800\uB141\uC5D0 \uB418\uB3C4\uB85D \uC77C\uCC0D \uC790\uB3C4\uB85D \uD558\uC790.</p></li></ul><br><br><br><h1 style="font-size:37px;margin:7px 0px 12px;">Try</h1><h4 id="\uC798\uD558\uACE0-\uC788\uB294-\uAC83\uC744-\uB354-\uC798\uD558\uAE30-\uC704\uD574\uC11C-\uBB38\uC81C\uAC00-\uC788\uB294-\uC810\uC744-\uD574\uACB0\uD558\uAE30-\uC704\uD574\uC11C-\uC6B0\uB9AC\uAC00-\uC2DC\uB3C4\uD574-\uBCFC-\uAC83\uB4E4" tabindex="-1">\uC798\uD558\uACE0 \uC788\uB294 \uAC83\uC744 \uB354 \uC798\uD558\uAE30 \uC704\uD574\uC11C, \uBB38\uC81C\uAC00 \uC788\uB294 \uC810\uC744 \uD574\uACB0\uD558\uAE30 \uC704\uD574\uC11C \uC6B0\uB9AC\uAC00 \uC2DC\uB3C4\uD574 \uBCFC \uAC83\uB4E4 <a class="header-anchor" href="#\uC798\uD558\uACE0-\uC788\uB294-\uAC83\uC744-\uB354-\uC798\uD558\uAE30-\uC704\uD574\uC11C-\uBB38\uC81C\uAC00-\uC788\uB294-\uC810\uC744-\uD574\uACB0\uD558\uAE30-\uC704\uD574\uC11C-\uC6B0\uB9AC\uAC00-\uC2DC\uB3C4\uD574-\uBCFC-\uAC83\uB4E4" aria-hidden="true">#</a></h4><hr><ul><li><p style="font-size:17px;font-weight:bold;">\uD68C\uC0AC \uD1F4\uADFC\uD558\uACE0 \uD504\uB85C\uC81D\uD2B8 \uAD00\uB828 \uC5B8\uC5B4\uB4E4\uC744 \uACF5\uBD80\uD558\uB294\uAC8C \uB108\uBB34 \uD798\uB4E4\uB2E4. \uC801\uC5B4\uB3C4 \uC8FC\uB9D0\uC5D0 \uB9CE\uC774 \uB9CC\uB4E4\uC5B4\uBCF4\uC790.</p></li></ul><br>',36)]))}var x=r(i,[["render",l]]);export{c as __pageData,x as default};
